import React, { Component } from 'react';
import { BrowserRouter, Route } from 'react-router-dom';

import Header from './Components/Header'
import BookManagement from './Components/BookManagement'
import Join from './Components/Join'
import Login from './Components/Login'
import Main from './Components/Main'
import MyInfo from './Components/MyInfo'

class App extends Component {
  state = {
    userId: "",
    userPassword: "",
    userManagement: 0,
  }
  render() {
    return (
      <BrowserRouter>
        <Header></Header>
        <Route exact path="/" render={(props) => <Main {...this.state} {...props}></Main>} />
        <Route path="/join" render={(props) => <Join {...this.state} {...props}></Join>} />
        <Route path="/login" render={(props) => <Login {...this.state} {...props}></Login>} />
        <Route path="/myInfo" render={(props) => <MyInfo {...this.state} {...props}></MyInfo>} />
        <Route path="/bookManagement" render={(props) => <BookManagement {...this.state} {...props}></BookManagement>} />
      </BrowserRouter>
    );
  }
}

export default App;
